INSERT INTO ARTICLE (ID, TITRE, SYNOPSIS, CONTENT, LOCALDATE, TAGS) VALUES (1, 'Installer WSL avec Windows 10', 'Installez le sous-système Linux pour profiter d’un Linux sous Windows', '<p>Chers amis,&nbsp;</p><p>Voici le premier article d’une longue je l’espère qui seront disponibles sur mon site. Je vous remercie par avance pour les prochaines années que je pourrais passer à vos côtés.</p><p>Donc, installer WSL.&nbsp;</p><h2>Tout d’abord pourquoi&nbsp;?</h2><p>&nbsp;</p><p>WSL est un sous système Linux disponible sur Windows. Vous bénéficiez donc d’une forme de dual-boot sur votre machine pour les tâches simples ou tout simplement pour les habitués de la console (pas de Konsole ici).</p><p>D’une «&nbsp;forme&nbsp;» d’une part car Windows, étant propriétaire, va à l’encontre de l’esprit Open Source défendu par Linux depuis des années. Donc faire du Linux sous Windows c’est à peu près aussi logique que couper son fromage à la scie sauteuse.</p><p>D’autre part, certaines fonctionnalités sont limitées, notamment l’affichage graphique des applications.</p><p>Cependant, Microsoft a bien changé au cours des années, nous sommes désormais loin de la déclaration d’un ancien CEO qui déclarait&nbsp;:&nbsp; <a href="https://www.ginjfo.com/actualites/logiciels/linux/windows-linux-cancer-rival-20160311">"Linux est un cancer"</a>.</p><p>Malgré toutes ces choses, le WSL peut se réveler pratique notamment par l’utilisation de commandes réservées à Linux telles que les «&nbsp;grep, man&nbsp;» et quelques autres commandes indisponibles sous windows ou exclusives au powershell.</p><p>De plus, vous pouvez également installer quelques package directement dans ce sous système.</p><p>&nbsp;</p><h2>Installation&nbsp;:&nbsp;</h2><h2>Prérequis&nbsp;:&nbsp;</h2><p>Ouvrir la barre de recherche windows et tapez «&nbsp;fonctionnalités windows&nbsp;»&nbsp;:&nbsp;</p><figure class="image"><img src="data:image/png;base64,"></figure><p>Activez ensuite la fonctionnalité sous-système Windows pour linux&nbsp;:</p><figure class="image"><img src="data:image/png;base64,"></figure><p>Redémarrez votre ordinateur.</p><h2>Installation&nbsp;:</h2><p>Une fois redémarrer, rendez-vous dans le store Windows et tapez Linux&nbsp;:&nbsp;</p><figure class="image"><img src="data:image/png;base64,', '2020-05-29', '1');
INSERT INTO ARTICLE (ID, TITRE, SYNOPSIS, CONTENT, LOCALDATE, TAGS) VALUES (2, 'Démarrez une application Spring Boot rapidement', 'Démarrez un projet avec Spring-boot', '<p>Aujourd’hui, nous verrons comment démarrer un projet Spring boot.</p><p><i>NB&nbsp;: Certains outils facilitent grandement la rapidité avec laquelle démarrer un projet spring boot.</i></p><p><i>Je recommande activement l’utilisation d’Intellij si vous pouvez vous le permettre, sinon l’editeur VS code founir par Microsoft m’a également beaucoup surpris. Nous présenterons le départ avec cet IDE en raison de sa gratuité.</i></p><p>Installez <a href="https://code.visualstudio.com/">VS Code</a>.</p><p>Téléchargez l’extension Spring Initializr Java Support fournie par Microsoft dans le store de l’application.</p><figure class="image"><img src="data:image/png;base64,', '2020-05-29', '2');